import React from "react";
import { Tile } from "../../components/tile/Tile";

export const TileList = ({ tiles }) => {
  return (
    <div>
      {tiles.map((tile, index) => {
        const { name, phone, email } = tile.description; // Extract properties from description
        return <Tile key={index} name={name} description={{ phone, email }} />;
      })}
    </div>
  );
};





